window.bookSummaryJSON = "<p><b>Can she bake a winning cake without getting iced? </b></p> <p>Competition is hotter than the pre-heated ovens as The Great British Baking Competition moves into cake week. Amateur baker Poppy Wilkinson has a lot to deal with, from learning she has talents she never knew about, to trying to keep cool and bake under pressure.</p> <p>She’s also trying to track down the secrets of her parentage. Meanwhile, she’s saved from death by a local Border collie who seems to think she’s part of his flock and herds her out of danger. Was it an accident or does someone want her out of the baking competition permanently?</p> <p>With witches, an energy vortex, and an ancient manor house that holds it’s secrets tight, Poppy’s barely got time to practice her fondant icing, never mind escaping from a killer.&nbsp;</p> <p><b>Taste this culinary cozy mystery series from </b><b><i>USA Today</i></b><b> best-selling author Nancy Warren. Each book is a stand-alone mystery, though the books are linked. They offer good, clean fun and, naturally, recipes. </b></p>"; 
